const Person = (props) => {
    return (
        <div style={{ border: '3px solid rgba(0, 0, 150, 0.5)', margin: '10px' }}>
            <strong>Имя</strong>: {props.person.full_name}, <strong>email: </strong> {props.person.email}, <strong>телефон:</strong> {props.person.phone}
        </div>
    );
};

export default Person
